import React from 'react';
import { StyleSheet } from 'react-native';


const styles = StyleSheet.create ({
    button: {
        width: 200,
        borderRadius: 8,
        paddingVertical: 14,
        paddingHorizontal: 10,
        backgroundColor: 'chartreuse'
        
    },

    buttonText: {
        color: 'black',
        fontWeight: 'bold',
        textTransform: 'uppercase',
        fontSize: 16,
        textAlign: 'center',
    },

    view: {
        backgroundColor: '#444',
        size: 'cover',
    },
})

export default styles;
